            <h1 id="title" class="text-4xl font-bold text-center mb-2 bg-gradient-to-r from-rose-600 to-pink-600 bg-clip-text text-transparent">
                MY MAN ARRIVES!!!
            </h1>
            
            <p id="date-display" class="text-center text-gray-600 mb-8 text-lg">
                Thursday, 27 March 2026 at 06:30
            </p>

            <div class="grid grid-cols-4 gap-4" id="countdown-grid">
                <div class="text-center">
                    <div class="bg-gradient-to-br from-rose-500 to-pink-600 rounded-2xl p-6 shadow-lg">
                        <div id="days" class="text-5xl font-bold text-white mb-2">0</div>
                        <div class="text-white/90 text-sm uppercase tracking-wider">Days</div>
                    </div>
                </div>

                <div class="text-center">
                    <div class="bg-gradient-to-br from-pink-500 to-rose-500 rounded-2xl p-6 shadow-lg">
                        <div id="hours" class="text-5xl font-bold text-white mb-2">0</div>
                        <div class="text-white/90 text-sm uppercase tracking-wider">Hours</div>
                    </div>
                </div>

                <div class="text-center">
                    <div class="bg-gradient-to-br from-rose-500 to-pink-600 rounded-2xl p-6 shadow-lg">
                        <div id="minutes" class="text-5xl font-bold text-white mb-2">0</div>
                        <div class="text-white/90 text-sm uppercase tracking-wider">Minutes</div>
                    </div>
                </div>

                <div class="text-center">
                    <div class="bg-gradient-to-br from-pink-500 to-rose-500 rounded-2xl p-6 shadow-lg">
                        <div id="seconds" class="text-5xl font-bold text-white mb-2">0</div>
                        <div class="text-white/90 text-sm uppercase tracking-wider">Seconds</div>
                    </div>
                </div>
            </div>

            <div id="celebration" class="text-center py-12 hidden">
                <div class="text-6xl mb-4"></div>
                <p class="text-2xl text-gray-700">The wait is over!</p>
            </div>
        </div>

        <div class="text-center mt-6 text-gray-600 text-sm">
            Made with love 
        </div>
    </div>

    <script>
        // Michael arrives March 27, 2026 at 6:30 AM Brisbane time
        const arrivalDate = new Date('2026-03-27T06:30:00+10:00');

        function updateCountdown() {
            const now = new Date();
            const difference = arrivalDate - now;

            if (difference > 0) {
                const days = Math.floor(difference / (1000 * 60 * 60 * 24));
                const hours = Math.floor((difference / (1000 * 60 * 60)) % 24);
                const minutes = Math.floor((difference / 1000 / 60) % 60);
                const seconds = Math.floor((difference / 1000) % 60);

                document.getElementById('days').textContent = days;
                document.getElementById('hours').textContent = hours;
                document.getElementById('minutes').textContent = minutes;
                document.getElementById('seconds').textContent = seconds;
            } else {
                document.getElementById('title').textContent = "HE'S HERE! ";
                document.getElementById('date-display').style.display = 'none';
                document.getElementById('countdown-grid').style.display = 'none';
                document.getElementById('celebration').classList.remove('hidden');
            }
        }

        // Update immediately and then every second
        updateCountdown();
        setInterval(updateCountdown, 1000);
    </script>
</body>
</html>
